import React from "react";

interface SquareProps {
    position: string;
    width: string;
    height: string;
    borderRadius: string;
    border: string;
    color: string;
    left: string;
    top: string;
}

const Square: React.FC<SquareProps> = ({
    position = "relative",
    width,
    height,
    borderRadius,
    border,
    color,
    left = "140px",
    top = "30.55px",
}) => {
    return (
        <div
            style={{
                width,
                height,
                borderRadius,
                border,
                color,
            }}
        ></div>
    );
};

export default Square;
